import React from 'react';
import styled from 'styled-components';
const Home = () => (
  <Container>
    <Heading>hi there</Heading>
  </Container>
);
const Container = styled.div`
  width: 960px;
  height: 100vh;
  margin: 2rem auto;
  padding: 2rem;
  background: #f2f2f2;
`;
const Heading = styled.h1``;
export default Home;
